import React from "react";
import { Loader } from "@googlemaps/js-api-loader";

const Map = () => {
  return (
    <iframe
      style={
        ((width = "600"),
        (height = "450"),
        (style = "border:0"),
        (loading = "lazy"),
        allowfullscreen)
      }
      src="https://www.google.com/maps/embed/v1/place?key=AIzaSyCwggY-q5j2oeeXfFTw8ZkTv1-h2GZayvI
      &q=Space+Needle,Seattle+WA"
    ></iframe>
  );
};

export default Map;
